 нужно предоставить исходный код на cи/c++, чтобы строки шифровались похожим образом 

#include "stdafx.h"
#include <iostream>
#include <vector>

#ifdef _DEBUG
#error Please build in Release
#endif

using namespace std;

int ZERO = 0;
#define NONINLXOR(x, y) ((x) ^ (y+ZERO))
#define INLXOR(x, y) ((x) ^ (y))
#define CRYPT(x,salt) NONINLXOR(INLXOR(x,salt),salt)
#define TO_STRING(x) #x
#define TO_STRING(x,y) #x","#y
#define CHAR_CHUNK(x)   (TO_STRING(x)[0]) + (TO_STRING(x)[1]<<8)+(TO_STRING(x)[2]<<16)+(TO_STRING(x)[3]<<24)
#define GEN_SALT ((__LINE__ * 707) % 0xFFFF)
#define CRCH(s) CRYPT(CHAR_CHUNK(s),GEN_SALT)
//
int main(){
vector<int> arr = { CRCH(Cong) ,CRCH(ratu),CRCH(lati),CRCH(ons,),CRCH(\ you),CRCH(\ mad),CRCH(e it),CRCH(!\0\0\0) };
char *p = (char*)arr.data();
cout << &p[0]<<endl;
    return 0;
}
